import ListGroup from "react-bootstrap/ListGroup";

const MisList = ({ mis }) => {
  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <ListGroup.Item as="li" key={mis.id}>
                {mis.institution}
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
